        fetch('/api/players')
            .then(res => res.json())
            .then(players => this.setState({players: players.playerStatsTotals}))


    }

    render() {
        const { players } = this.state;
        console.log(players)
        return (
          <ul>
            {players.map(player =>
              <li key={player.id}>
                <p>{player.firstName}</p>
              </li>
            )}
          </ul>
        );
      }



}

